import React, { useState } from 'react';
import { createQR } from './api'; // Import your API function

function CreateQR() {
  const [qrData, setQRData] = useState({
    name: '',
    contact: '',
    website: '',
  });

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setQRData({
      ...qrData,
      [name]: value,
    });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      // Call your API function to create the QR code
      await createQR(qrData);
      alert('QR code generated successfully');
      // You can redirect to another page if needed
    } catch (error) {
      console.error('Error generating QR code:', error);
    }
  };

  return (
    <div>
      <h2>Create QR Code</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input
            type="text"
            name="name"
            value={qrData.name}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>Contact:</label>
          <input
            type="text"
            name="contact"
            value={qrData.contact}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <label>Website:</label>
          <input
            type="text"
            name="website"
            value={qrData.website}
            onChange={handleInputChange}
            required
          />
        </div>
        <div>
          <button type="submit">Generate QR Code</button>
        </div>
      </form>
    </div>
  );
}

export default CreateQR;
